import React, {Component} from 'react';
import axios from 'axios';

export default class Calendar extends Component{


  state = {
    loading: true,

    data: []
  }

  componentDidMount(){
    //let's look into the voss way of replacing this variable below
    axios.get("http://localhost:5000/calendar")
      .then((res) => {
        var grab = [];
        try{
          for(var m = 0; m < res.data.data.length; m+=3){
            grab.push({
              start: res.data.data[m],
              end: res.data.data[m+1],
              event: res.data.data[m+2],
            })
          }
        }catch(e){
          console.log(e);
        }

        this.setState({
          day: res.data.date,
          data: grab,
          loading: false
        })
      })

  }


  render(){



    return(
      <div>
      </div>
    )
  }
}
